// frontend/src/components/PredictForm.js
import React, { useState } from 'react';
import axios from 'axios';

const PredictForm = ({ modelType }) => {
  const [inputData, setInputData] = useState([]);
  const [prediction, setPrediction] = useState(null);

  const handleInputChange = (e, index) => {
    const values = [...inputData];
    values[index] = e.target.value;
    setInputData(values);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(`${process.env.REACT_APP_API_URL}/predict/${modelType}`, {
        dense_2_input: inputData
      });
      setPrediction(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input type="text" onChange={(e) => handleInputChange(e, 0)} placeholder="Input 1" />
      <button type="submit">Predict</button>
      {prediction && <div>Prediction: {JSON.stringify(prediction)}</div>}
    </form>
  );
};

export default PredictForm;
